import React, {Component} from 'react';
import Reveal from 'react-reveal/Reveal/';
import { translate } from "react-translate";


class BannerClients extends Component{
    render(){
    
            let {Â t } = this.props;

        return(
            <section className="banner_clients_area">
                <ul className="list-unstyled cloud_animation">
                    <li><img src={require ("../../img/clients/cloud_01.png").default} alt=""/></li>
                    <li><img src={require ("../../img/clients/cloud_02.png").default} alt=""/></li>
                    <li><img src={require ("../../img/clients/cloud_03.png").default} alt=""/></li>
                    <li><img src={require ("../../img/clients/cloud_04.png").default} alt=""/></li>
                    <li><img src={require ("../../img/clients/cloud_05.png").default} alt=""/></li>
                    <li><img src={require ("../../img/clients/cloud_06.png").default} alt=""/></li>
                </ul> 
                
                <div className="section_intro">
                    <div className="section_container">
                        <div className="intro">
                            <div className=" intro_content seo_banner_content">
                                <Reveal effect="fadeInUp" duration={500}>
                                    <h2>{t(this.props.title_cb)}</h2>
                                </Reveal> 
                                <Reveal effect="fadeInUp" duration={1000}>
                                <p>{t(this.props.title_d)}</p>
                                </Reveal>
                            </div>
                        </div>
                        
                    </div> 
                </div>
            </section>
        )
    }
}

export default translate('ClientsBanner')(BannerClients);
